import React from "react";
import LogoBootstrap from '../Img/bootstrap-5Logo.svg';
import LogoHTML from '../Img/html5Logo.png';

import '../Css/Inicio.css';

function Inicio(){
  return(
    <div className="contenedorDivs">
      <div className="quienSoyCont">
        <h1>Quien soy</h1>
        <label>Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae qui facere distinctio autem rerum fugit iure molestias praesentium, amet eius, commodi ipsam quia optio neque itaque vel labore suscipit dolorum!</label>
      </div>

      <div className="a">
        <h1>Habilidades en</h1>
        <div className="contenedorImagenes">
          <img
            className="logoBootstrap"
            src={LogoBootstrap}
            alt="Bootstrap logo" />
          <img
            className="logoHTML"
            src={LogoHTML}
            alt="Bootstrap logo" />
          <img
            className="logoBootstrap"
            src={logoBootstrap}
            alt="Bootstrap logo" />
          <img
            className="logoBootstrap"
            src={logoBootstrap}
            alt="Bootstrap logo" />
          <img
            className="logoBootstrap"
            src={logoBootstrap}
            alt="Bootstrap logo" />
          <img
            className="logoBootstrap"
            src={logoBootstrap}
            alt="Bootstrap logo" />
        </div>
      </div>  

      <div className="">
        <label>IMAGEN RANDOM</label>
      </div>
      <div className="">
        <h1>MIS PROYECTOS</h1>
      </div>

      <div className="">
        <h1>Herramientas que utilizo</h1>
      </div>
    </div>
  );
};

export default Inicio;
